import lift from './res/girl-lift.png'
import railing from './res/railing.png'
import sky from './res/sky.png'
import terrace from './res/terrace.jpg'
import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

function App() {
  return (
    <div class = "flex-container">
    <Parallax pages={4}>
      {/* // page 1 */}
      <div>
      <ParallaxLayer
        offset={0}
        speed={1}
        factor={4}
        style={{
          backgroundImage: `url(${terrace})`,
          backgroundSize: '100%',
          flex: 1
        }}
      ></ParallaxLayer>
      </div>
      {/* //elevator */}
      <div>
      <ParallaxLayer
        sticky={{ start: 0.2, end: 2.5 }}
        style={{ textAlign: 'left', flex: 2 }}
      >
        <img src={lift} />
      </ParallaxLayer>
      </div>
      {/* // page 2 */}
      <ParallaxLayer
        offset={1}
        speed={1}
        factor={1}
        style={{
          backgroundImage: `url(${sky})`,
          backgroundSize: 'cover',
        }}
      ></ParallaxLayer>

      {/* // page 3 */}
      <ParallaxLayer
        offset={2}
        speed={1}
        factor={1}
        style={{
          backgroundImage: `url(${sky})`,
          backgroundSize: 'cover',
        }}
      ></ParallaxLayer>

    </Parallax>
  </div>
  );
}

export default App;
